import React from "react";
import TodoItemShow from "./TodoItemShow";

const TodoItemList = (props) => {
  return (
    <ul>
      {props.items.map((item) => (
        <TodoItemShow key={item.id} id={item.id} onDelete={props.onDeleteTask}>
          {item.text}
        </TodoItemShow>
      ))}
    </ul>
  );
};
export default TodoItemList;
